  </div>

  {stateapi.Search?.map((ele,id)=>{
      return(
          <>
            <h1>{ele.Title}</h1>
          </>
      )
  })}





{/* <button onClick = {fetchPost}>Fetch Api</button> */}
<div>
                <Details2
